        if (event.sourceElement.isAnswerSelected(['_8'])) {

            OSM.Survey.get('navigator').goTo(OSM.Survey._ChamDut);
        }
    }

    //2.	Ngưng nếu Q3a=8 và Q3b=1-10
    if (OSM.Survey._Q3a.isAnswerSelected(['_8']) ) {

