        //     }
        // }
    }

    //3.	Ngưng nếu Q3a=97 và Q3b≠12/13 -> bỏ
    // if (OSM.Survey.countCategories(OSM.Survey._Q3a.getAnswers()) == 1) {

    //     if (OSM.Survey._Q3a.isAnswerSelected(['_97'])) {

    //         //Check nếu không có câu trả lời nằm trong các code còn lại -> chỉ chọn 12 hoặc 13
