//Q4
OSM.Survey.addEventListenersToElements(['_Loop_Q4_Num'], 'onNext', function(event) {

    var iteration = event.sourceElement.parent();
    var iterationName = event.sourceElement.parent().get('objectName');

    console.log('Q4');
    var ans = parseFloat(event.sourceElement.getComment());

    switch(true) {
        case (ans < 3):
            OSM.Survey.initializeQuestion(iteration._Loop_Q4_Recode, ['_1']);
            break;
        case (ans >= 3 && ans < 5):
            OSM.Survey.initializeQuestion(iteration._Loop_Q4_Recode, ['_2']);
            break;
        case (ans >= 5 && ans < 10):
            OSM.Survey.initializeQuestion(iteration._Loop_Q4_Recode, ['_3']);
            break;
        case (ans >= 10 && ans < 15):
            OSM.Survey.initializeQuestion(iteration._Loop_Q4_Recode, ['_4']);
            break;
        case (ans >= 15):
            OSM.Survey.initializeQuestion(iteration._Loop_Q4_Recode, ['_5']);
            break;
    }
});
