//Q6
OSM.Survey.valCheckQ6 = function(event) {

    var arr_412 = ['_4','_12'];
    var arr_56 = ['_5','_6'];
    var arr_78 = ['_7','_8'];
    var arr_910 = ['_9','_10'];
    var Lbl_err = ""
    var count = 0;

    var ans = event.sourceElement.getAnswers();

    if (OSM.Survey.intersectionArrListCatsWith(ans, arr_412).length == 2) {

        count++;
        Lbl_err = "Phó phòng/khoa không được chọn cùng Phó phòng/khoa kiêm nhiệm quyền trưởng phòng/khoa"
    }

    if (OSM.Survey.intersectionArrListCatsWith(ans, arr_56).length == 2) {

        count++;
        Lbl_err = "Giáo sư không được chọn cùng Phó giáo sư"
    }

    if (OSM.Survey.intersectionArrListCatsWith(ans, arr_78).length == 2) {

        count++;
        Lbl_err = "Tiến sĩ không được chọn cùng Thạc sĩ"
    }

    if (OSM.Survey.intersectionArrListCatsWith(ans, arr_910).length == 2) {

        count++;
        Lbl_err = "Bác sĩ chuyên khoa I không được chọn cùng Bác sĩ chuyên khoa II"
    }

    if (count > 0) {

        return {
            status: false,
            message: Lbl_err
        }
    }
}

OSM.Survey._Q6a.addEventListener('onEntrance', function(event) {

    console.log("Q6a");
    //CHỈ SHOW CODE 97 ở Q6a NẾU [Q3a=8 hoặc 97 only] và Q3b=11/12/13/14/15/97
    if (OSM.Survey.countCategories(OSM.Survey._Q3a.getAnswers()) == 1) {

        if (OSM.Survey._Q3a.isAnswerSelected(['_8','_97']) && OSM.Survey._Q3b.isAnswerSelected(['_11','_12','_13','_14','_15','_97'])) {

            OSM.Survey.initializeQuestion(event.sourceElement, ['_1','_2','_3','_4','_12','_11','_97']);
        } 
        //Trường hợp chỉ chọn 1 code mà thuộc 1 - 7
        else {

            OSM.Survey.initializeQuestion(event.sourceElement, ['_1','_2','_3','_4','_12','_11']);
        }
    } else {

        OSM.Survey.initializeQuestion(event.sourceElement, ['_1','_2','_3','_4','_12','_11']);
    }   
});

