            q.show();
        }

        //HOẶC NẾU Q6=code 4 & Q10a1=code 4 & Q10a2=code 2/3 
        if (s._Q6a.isAnswerSelected(['_4']) && s._Q10a1.isAnswerSelected(['_4']) && s._Q10a2.isAnswerSelected(['_2','_3'])) {

            q.show();
        }
    }
});

OSM.Survey._Q10c.addEventListener('onNext', function(event) {

    /*NGƯNG NẾU 1 TRONG CÁC TRƯỜNG HỢP SAU:
    +Q6a = 4 & Q9=5 & Q10b=1/2 & Q10a1=code 2/3 & Q10c=code 2
    +Q6a = 4 & Q9=5 & Q10b=2 & Q10a1=code 4 & Q10a2=2/3 & Q10c=code 2 */

    if (OSM.Survey.countCategories(OSM.Survey._Q6a.getAnswers()) == 1) {

        if (OSM.Survey._Q6a.isAnswerSelected(['_4'])) {

            if (OSM.Survey._Q9.isAnswerSelected(['_5'])) {

                if (OSM.Survey._Q10b.isAnswerSelected(['_1','_2'])) {

                    if (OSM.Survey._Q10a1.isAnswerSelected(['_2','_3'])) {

                        if (event.sourceElement.isAnswerSelected(['_2'])) {

                            OSM.Survey.get('navigator').goTo(OSM.Survey._ChamDut)
                        }
                    }
                }
                else if (OSM.Survey._Q10b.isAnswerSelected(['_2'])) {

                    if (OSM.Survey._Q10a1.isAnswerSelected(['_4'])) {

                        if (OSM.Survey._Q10a2.isAnswerSelected(['_2','_3'])) {

                            if (event.sourceElement.isAnswerSelected(['_2'])) {

                                OSM.Survey.get('navigator').goTo(OSM.Survey._ChamDut)
                            }
                        }
                    }
                }
            }
        }
    }
});

