//Q12
OSM.Survey.valCheckQ12 = function(event) {

    var q12a = parseInt(OSM.Survey._Q12._Q12a_Num.getComment());
    var q12b = parseInt(OSM.Survey._Q12._Q12b_Num.getComment());
    var q12c = parseInt(OSM.Survey._Q12._Q12c_Num.getComment());

    if (q12b > q12a) {

        return {

            status: false,
            message: "Số bệnh nhân không được vượt quá tổng số bệnh nhân được thăm khám"
        }
    }

    if (q12c > q12a) {

        return {

            status: false,
            message: "Số bệnh nhân không được vượt quá tổng số bệnh nhân được thăm khám"
        }
    }
}
