//Q201ab
OSM.Survey.valCheckQ201ab = function(event) {

    if (event.sourceElement.isAnswerSelected(['_1'])) {

        if (!event.sourceElement.isAnswerSelected(['_2'])) {

            return {
                status: false,
                message: "Vui lòng điền cả Chức vụ/khoa phòng & Vai trò trong việc quyết định"
            }
        }
    }

    if (event.sourceElement.isAnswerSelected(['_2'])) {

        if (!event.sourceElement.isAnswerSelected(['_1'])) {

            return {
                status: false,
                message: "Vui lòng điền cả Chức vụ/khoa phòng & Vai trò trong việc quyết định"
            }
        }
    }

    return true
}

