            q.show();
        }
    }
});

OSM.Survey.addEventListenersToElements(['_Q27b_Text'], 'onBeforeAsk', function(s, q) {

    q.hide();

    if (s.countCategories(s._Q27.getAnswers()) == 2) {

        if (!s._Q27.isAnswerSelected(['_3'])) {

            q.show();
        }
    }
});

